import { Component } from "react";
class Singleclass extends Component {
  constructor(props) {
    console.log(props);
  }

  render() {
    return (
      <>
        <div className="col-md-4 text-center">
          <div className="team-member p-3 shadow">
            <img
              src="https://images.pexels.com/photos/927022/pexels-photo-927022.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
              alt=""
            />
            <h4>Sajjad Hossain</h4>
            <h6>mern stack developer</h6>
          </div>
        </div>
      </>
    );
  }
}
export default Singleclass;
